import React from 'react';
import { ContentHeader, i18n } from 'config/C4';

const WorkView = () => {
  const { workview } = i18n();
  return (
    <div className="workView">
      <ContentHeader title={workview.title} />
    </div>
  )
}

export default WorkView;
